import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import '../StyleSheets/customise.css';

function customise() {
    return (
        <div className="container-customise-dashboard">
            <h1>Customise the DashBoard</h1>

            <div className='content-div'>

                <table>
                    <tr>
                        <td><label className='label-textbox'>Total Income</label></td>
                        <td><TextField id="outlined-basic" label="Outlined" variant="outlined" /></td>
                    </tr>
                    <tr>
                        <td></td>
                    </tr>
                </table>


                <div>
                
                </div>
                <div>
                <label className='label-textbox'>Targeted Monthly Expense</label><TextField id="outlined-basic" label="Outlined" variant="outlined" />
                </div>

            </div>
            
            


        </div>
    );
}

export default customise;
